function add_descriptions(table)
  for k, v in pairs(table) do
    obj = getObjectFromGUID(k)
    description = ""

    description = description .. add_effects("", v.extra)
    description = description .. add_effects("When played...", v.on_enter)
    description = description .. add_effects("When activated...", v.on_going)
    description = description .. add_effects("When defeated...", v.on_defeat)


    obj.setName(v.name)
    obj.setDescription(description)
  end
end

function add_effects(header, phase)
  description = header .. "\n"
  if phase then
    for i, effect in ipairs(phase) do
      description = description .. ABILITIES[effect] .. "\n\n"
    end
  else
    return ""
  end
  return description
end

function new_player(params)
