    copy = obj.clone({})
    pos = {x = position.x, y = y, z = position.z}
    --update the value of y for the next card in the stack
    y = y + copy.getBounds().size.y + 0.1 --add 0.1 to fix bug with out-of-order cards
    copy.setLock(false)
