function to_string(x)

  if type(x) == 'nil' or type(x) == 'boolean' or type(x) == 'number' or type(x) == 'string' then
    return tostring(x)
  end

  if type(x) == 'userdata' then
    return 'userdata'
  end

  if type(x) == 'function' then
    return 'function'
  end

  if type(x) == 'thread' then
    return 'thread'
  end

  if type(x) == 'table' then
    result = "{"
    count = false
    for k,v in pairs(x) do
      if count then
        result = result .. ","
      end
      result = result .. " " .. k .. " = " .. to_string(v)
      count = true
    end
    result = result .. " }"
    return result
  end

end

function split(str, pat)
   local t = {}  -- NOTE: use {n = 0} in Lua-5.0
   local fpat = "(.-)" .. pat
   local last_end = 1
   local s, e, cap = str:find(fpat, 1)
   while s do
      if s ~= 1 or cap ~= "" then
         table.insert(t,cap)
      end
      last_end = e+1
      s, e, cap = str:find(fpat, last_end)
   end
   if last_end <= #str then
      cap = str:sub(last_end)
      table.insert(t, cap)
   end
   return t
end

