  colors['Black'] = { 0, 0, 0 }
  colors['Yellow'] = { 255, 255, 0 }
  colors['Blue'] = { 0, 0, 255 }
  colors['Green'] = { 0, 255, 0 }
  colors['Red'] = { 255, 0, 0 }
  colors['White'] = { 255, 255, 255 }
  return colors[color]
end

function color_string(val)
  local results = { "Black", "Yellow", "Blue", "Green", "Red", "White"}
  return results[val]
end

rolling = false
skip_on_load = 0


function onCollisionEnter(collision_info)
  rolling = true
  skip_on_load = skip_on_load + 1
end


function onCollisionStay(collision_info)
  if rolling and skip_on_load > 2 and check_velocity(self.getVelocity()) then
    rolling = false
    color = color_string(self.getValue())
    Timer.destroy("update_die" .. self.getGUID())
    Timer.create({
      identifier     = "update_die" .. self.getGUID(),
      function_name  = "update_die",
      delay          = 1
    })

  end
end

function update_die()
  self.setName("Tao Die: " .. color_string(self.getValue()))
end

function check_velocity(velocity)
  for k,v in pairs(velocity) do
    if v > 0 then
      return false
    end
  end
  return true
end

